import React, { Component } from "react";
import "./App.css";
import Nav from "./Nav/Nav";
import Download from "./Download/Dow";
import Works from "./Works/works";
import Card from "./Card/Card";
import GettingStarted from "./GettingStarted/GettingStarted";
import Footer from "./Footer/Footer";
import CardDot from "./CardDot/CardDot";

class App extends Component {
  render() {
    return (
      <div>
        <Nav />
        <Download />
        <h1>
          <br />
        </h1>
        <CardDot />
        <h1>
          <br />
        </h1>
        <Works />
        <br />
        <Card />
        <br />
        <GettingStarted />
        <br />
        <br />
        <div className="container text-center">
          <h2>Why are you waiting?</h2>
          <h4>Fill the form to hear from us.</h4>
          <form>
            <input type="text" name="fname" placeholder="Name"/>
            <input type="text" name="fname" placeholder="Mobile No"/>
            <input type="text" name="fname" placeholde /><br/>
            <input type="submit" value="Request a call"/>
          </form>
        </div>
        <Footer />
      </div>
    );
  }
}

export default App;
